import React from "react";

function Nav(props) {
  /*

  <a className="et-hero-tab" href="#"+{props.this.header.href}>{props.this.header.name}</a>



  */

  return (
    <div>
      <section className="et-hero-tabs">
        <h1>Marquise Piton</h1>
        <h3>I build websites as If I am telling a story </h3>
        <div className="et-hero-tabs-container">
          <a className="et-hero-tab" href={props.this.header.href}>
            {props.this.header.name}
          </a>
          <span className="et-hero-tab-slider"></span>
        </div>
      </section>
    </div>
  );
}

export default Nav;
